/**
 * Simple function to "mock" the server when fetching Lessons + Exercises
 * In real implementation we will need to fetch data in a smart way, infinity scroll,
 *  but it's just a test.
 */
export function getLessons() {
  return new Promise(resolve => {
    console.log('"getLessons" call.');
    // To simulate a bit of delay
    setTimeout(() => {
      resolve(lessons);
    }, 1000);
  });
}
/**
 * I imagine also a method like that to get just one lesson
 */
export function getLesson(lessonId) {
  return new Promise((resolve, reject) => {
    console.log(`"getLesson" call for "${lessonId}"`);
    // To simulate a bit of delay
    setTimeout(() => {
      const lesson = lessons.find(e => e.id === lessonId);
      if (lesson) {
        resolve(lesson);
      } else {
        reject(new Error(`Lesson ${lessonId} not found`));
      }
    }, 1000);
  });
}
/**
 * Again, here just resolving always the same exercises, doesn't matter
 * the lesson sent, this won't be the case for real implementation
 */
export function getExercises(lessonId) {
  console.log(`"getExercises" call for "${lessonId}"`);
  return new Promise(resolve => {
    setTimeout(() => {
      resolve(exercises);
    }, 1000);
  });
}
